import React from "react";
import Layout from "../components/Layout";

function account() {
  this.print();
  return (
    <Layout>
      <div>Account</div>
    </Layout>
  );
}
account.prototype.print = () => {};
Object.setPrototypeOf(Counter.prototype, React.Component.prototype);

export default new account();
